package com.example.test.Entity;import jakarta.persistence.*;import lombok.AllArgsConstructor;import lombok.Builder;import lombok.Data;import lombok.NoArgsConstructor;@Entity@Table@AllArgsConstructor@NoArgsConstructor@Data@Builderpublic class Likes {    @Id    @GeneratedValue(strategy = GenerationType.IDENTITY)    private Long likeId;    private boolean liked;    @ManyToOne    @JoinColumn(name ="id")    private User user;    @ManyToOne    @JoinColumn(name ="postId")    private Post post;}